  useEffect(() => {
    props.setNavIndex("");
  }, []);
  useEffect(() => {
    props.setUserColor("");
    props.setUnmount(false);
  });
  return (
    <>
      <Banner unmount={props.unmount} />
    </>
  );
};

export default Main;
